import{_ as t,c as a,a5 as n,o as i}from"./chunks/framework.CHhwEXkI.js";const u=JSON.parse('{"title":"Bio-Lab1","description":"","frontmatter":{"date":"2024-09-25T00:00:00.000Z","title":"Bio-Lab1","status":"DONE","author":["AllenYGY"],"tags":["Lab","Bioinfo"],"publish":true},"headers":[],"relativePath":"posts/Bioinfo/Lab/Lab-1/Bioinfo-Lab-1.md","filePath":"posts/Bioinfo/Lab/Lab-1/Bioinfo-Lab-1.md","lastUpdated":null}'),s={name:"posts/Bioinfo/Lab/Lab-1/Bioinfo-Lab-1.md"};function o(r,e,l,c,h,p){return i(),a("div",null,e[0]||(e[0]=[n('<h1 id="bioinfo-lab-1" tabindex="-1">Bioinfo-Lab-1 <a class="header-anchor" href="#bioinfo-lab-1" aria-label="Permalink to &quot;Bioinfo-Lab-1&quot;">​</a></h1><h2 id="task-1" tabindex="-1">Task 1 <a class="header-anchor" href="#task-1" aria-label="Permalink to &quot;Task 1&quot;">​</a></h2><p><strong>Using the human APOBEC3A (hAPOBEC3A) protein sequence (ID: NP_663745.1) as query, use BLASTp to search for its homologous protein sequence.</strong></p><p><img src="https://cdn.jsdelivr.net/gh/ALLENYGY/ImageSpace@main/uPic/9IPRfp.png" alt="homologous protein sequence"></p><hr><h2 id="task-2" tabindex="-1">Task 2 <a class="header-anchor" href="#task-2" aria-label="Permalink to &quot;Task 2&quot;">​</a></h2><p>**For the APOBEC3A.fasta ﬁle (from iSpace), perform multiple sequence alignment and construct phylogenetic tree. **</p><p><em><strong>Multiple Sequence Alignment</strong></em></p><p><img src="https://cdn.jsdelivr.net/gh/ALLENYGY/ImageSpace@main/uPic/k0LeCY.png" alt="MSA"></p><p><em><strong>Phylogenetic Tree</strong></em></p><h2 id="" tabindex="-1"><img src="https://cdn.jsdelivr.net/gh/AllenYGY/ImageSpace@main/uPic/fovUE1.png" alt="Phylogenetic Tree"> <a class="header-anchor" href="#" aria-label="Permalink to &quot;![Phylogenetic Tree](https://cdn.jsdelivr.net/gh/AllenYGY/ImageSpace@main/uPic/fovUE1.png)&quot;">​</a></h2><h2 id="task-3" tabindex="-1">Task 3 <a class="header-anchor" href="#task-3" aria-label="Permalink to &quot;Task 3&quot;">​</a></h2><p>**Attempt to interpret the results of this phylogenetic tree. **</p><p>The phylogenetic tree shows evolutionary relationships between primate species based on the APOBEC3A gene. Species that are closer together, such as orangutans (Pongo pygmaeus) and orangutans (Pongo abelii), have a more recent common ancestor, while species that are more distant, such as Homo sapiens and Colobus guereza, are more distantly related. The number next to each species represents genetic distance, with higher values indicating greater differences from a common ancestor. The scale (0.10) helps explain these distances. Overall, the tree reflects the evolutionary history of these primates.</p><hr><h2 id="task-4" tabindex="-1">Task 4 <a class="header-anchor" href="#task-4" aria-label="Permalink to &quot;Task 4&quot;">​</a></h2><p><strong>Based on the phylogenetic tree, select the sequences closest to hAPOBEC3A and generate pairwise sequence alignment, attempt to interpret the speciﬁc diﬀerences between the two sequences (hAPOBEC3A and target sequence).\u2028 Closest: Pongo pygmaeus APOBEC3A protein \u2028</strong></p><p><img src="https://cdn.jsdelivr.net/gh/ALLENYGY/ImageSpace@main/uPic/dHUBrm.png" alt="Pairwise sequence alignment"></p><p>The pairwise alignment between human APOBEC3A and <em>Pongo pygmaeus</em> APOBEC3A shows 88.4% identity and 93.5% similarity, with no gaps. Key differences include substitutions like Aspartic acid (D) to Cysteine (C) at position 15 and Phenylalanine (F) to Glutamic acid (E) at position 155, which could affect protein structure or function but likely don&#39;t drastically change its core role due to the high similarity.</p><hr>',20)]))}const m=t(s,[["render",o]]);export{u as __pageData,m as default};
